INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3700125800789', 'L’Exellence de Motta', 'Les meilleures dragées Nous élaborons avec soin les meilleures dragées en pensant qu\'elles accom gneront des évènements d\'exception. Sélectionner le meilleur choco at, Préserver sa saveur, trouver le bon équilibre entre le cœur et l\'enrob e de sucre... ce sont plus de dix érations qui nécessitent aire etpatience. Cette recherche d\'excel ence c\'est la volonté d\'être à la hauteur de vosgrands moments d\'émotion. Conseils d\'utilisation Cette boite de 500g contient environ 170 dragées. Vous pouvez les proposer suivant la tradition dans un drageoir où chacun les dégustera à I envie ou les offrir en ballotinspersonnalisés, dans ce cas n\'oubliezpas cette règle essentielle : Comptez en moyenne 10 dragéesParPersonne... mais 5 dragéespeuvent être une attention charmante si l\'on explique la tradition qui veut qu\'elles correspondent à cinq vœur : Fécondité, Félicité, Prospérité, Santé, Longévité.', 'https://static.openfoodfacts.org/images/products/370/012/580/0789/front_fr.4.400.jpg', '18.7', '11.5', '65.9', '60.4', '0', '4.5', '0.01', '0.00393700787401575', '', '0');

